object Solution {
    def findMaximumLength(nums: Array[Int]): Int = {
        if (nums.length <= 1) return nums.length
        val dp = Array.ofDim[Int](nums.length, nums.length)
        for (i <- nums.indices) dp(i)(i) = 1

        for (len <- 2 to nums.length) {
            for (i <- 0 to nums.length - len) {
                val j = i + len - 1
                if (nums(i) <= nums(i + 1)) dp(i)(j) = dp(i + 1)(j) max 2
                for (k <- i + 1 until j) {
                    if (nums(i) <= nums(k + 1)) dp(i)(j) = dp(i)(j) max (dp(i)(k) + dp(k + 1)(j))
                }
                dp(i)(j) = dp(i)(j) max dp(i)(j - 1)
            }
        }

        dp(0)(nums.length - 1)
    }
}
